  return (
      <>
      <Route>
        <React path ="/" element ={<Home/>}/>
        <React path ="/contact" element ={<Contact/>}/>
        <React path ="/Login" element ={<Login/>}/>
        <React path ="/Signup" element ={<Signup/>}/>
        <React path ="/Donate" element ={<Donate/>}/>
      </Route>
      </>
  );
}
*/

function App() {
  const [events] = useState([
    { id: 1, title: 'Event 1', date: '2025-02-10' },
    { id: 2, title: 'Event 2', date: '2025-02-12' },
    { id: 3, title: 'Event 3', date: '2025-02-14' },
  ]);

  return (
    <div className="App">
      {/* Header Section */}
      <header className="header">
        <div className="home">
          <p>Share the Care</p>
        </div>
        <div className="contact-info">
          <button>Contact Us</button>
        </div>
        <div className="login-signin">
          <button>Login</button>
          <button>Sign Up</button>
        </div>
        <div className="donation-bar">
          <p>Donate Now!</p>
          <button>Donate</button>
        </div>
      </header>

      {/* Main Content */}
      <main className="main-content">
        {/* Pictures Section (Top Middle) */}
        <div className="image-gallery">
          <img src={img1} alt= ""/>

        </div>

        {/* Events Section (Bottom) */}
        <section className="events">
          <h2>Upcoming Events</h2>
          <ul>
            {events.map((event) => (
              <li key={event.id}>
                <h3>{event.title}</h3>
                <p>Date: {event.date}</p>
              </li>
            ))}
          </ul>
        </section>
      </main>
    </div>
  );
}

export default App;
